import pokemons from "../data";
import Pokemon from "./Pokemon";


class PokeList extends React.Component {
    render () {
        <section>
            {pokemons.map((Pokemon, index) => (
                <Pokemon key={index} Pokemon={Pokemon} />
            ))}
        </section>

    }
}
